    const VIDEOS_PER_PAGE = 10;

    // Functions to render videos and pagination controls
    function renderVideos(videos, page = 1) {
      const container = document.getElementById('videoContainer');
      container.innerHTML = "";

      const startIndex = (page - 1) * VIDEOS_PER_PAGE;
      const endIndex = Math.min(startIndex + VIDEOS_PER_PAGE, videos.length);

      for (let i = startIndex; i < endIndex; i++) {
        const video = videos[i];
        const row = document.createElement('div');
        row.className = 'columns is-centered has-text-centered pr-5';
        row.style.alignItems = 'center';

        row.innerHTML = `
          <div class="column is-size-4">${video.caption}</div>
          <div class="column">
            <div class="pb-2 is-size-6">VideoCrafter</div>
            <video class="center" playsinline autoplay loop muted src="${video.videocrafterPath}" 
                   width="100%" style="border-radius:10px; max-height: 100%;"></video>
          </div>
          <div class="column">
            <div class="pb-2 is-size-6">VADER: PickScore Reward (Ours)</div>
            <video class="center" playsinline autoplay loop muted src="${video.pickscorePath}" 
                   width="100%" style="border-radius:10px; max-height: 100%;"></video>
          </div>
          <div class="column">
            <div class="pb-2 is-size-6">VADER: Aesthetic and HPS Reward (Ours)</div>
            <video class="center" playsinline autoplay loop muted src="${video.aestheticPath}" 
                   width="100%" style="border-radius:10px; max-height: 100%;"></video>
          </div>
        `;

        container.appendChild(row);
      }
    }

    function renderPagination(videos, currentPage = 1) {
      const paginationContainer = document.getElementById('pagination');
      paginationContainer.innerHTML = ""; // Clear previous pagination

      const totalPages = Math.ceil(videos.length / VIDEOS_PER_PAGE);
      const maxVisibleButtons = 5; // Maximum number of visible buttons at once
      const halfRange = Math.floor(maxVisibleButtons / 2);

      // Function to create a pagination button
      const createButton = (page, isActive = false, isEllipsis = false) => {
        const button = document.createElement('button');
        button.className = `button ${isActive ? 'is-primary' : ''} ${isEllipsis ? 'is-static' : ''}`;
        button.innerText = isEllipsis ? '...' : page;

        if (!isEllipsis) {
          button.addEventListener('click', () => {
            renderVideos(videos, page);
            renderPagination(videos, page);
          });
        }

        return button;
      };

      // Add "Previous" button
      if (currentPage > 1) {
        const prevButton = createButton(currentPage - 1, false);
        prevButton.innerText = "Previous";
        paginationContainer.appendChild(prevButton);
      }

      // Determine start and end pages for visible buttons
      let startPage = Math.max(1, currentPage - halfRange);
      let endPage = Math.min(totalPages, currentPage + halfRange);

      if (currentPage <= halfRange) {
        endPage = Math.min(totalPages, maxVisibleButtons);
      } else if (currentPage + halfRange >= totalPages) {
        startPage = Math.max(1, totalPages - maxVisibleButtons + 1);
      }

      // Add ellipsis if startPage is greater than 1
      if (startPage > 1) {
        paginationContainer.appendChild(createButton(1));
        if (startPage > 2) {
          paginationContainer.appendChild(createButton(null, false, true)); // Ellipsis
        }
      }

      // Add visible page buttons
      for (let i = startPage; i <= endPage; i++) {
        const button = createButton(i, i === currentPage);
        paginationContainer.appendChild(button);
      }

      // Add ellipsis if endPage is less than totalPages
      if (endPage < totalPages) {
        if (endPage < totalPages - 1) {
          paginationContainer.appendChild(createButton(null, false, true)); // Ellipsis
        }
        paginationContainer.appendChild(createButton(totalPages));
      }

      // Add "Next" button
      if (currentPage < totalPages) {
        const nextButton = createButton(currentPage + 1, false);
        nextButton.innerText = "Next";
        paginationContainer.appendChild(nextButton);
      }
    }

    document.addEventListener('DOMContentLoaded', () => {
      renderVideos(videoData, 1);
      renderPagination(videoData, 1);
    });
  </script>
